$("#bt1").click(function () {
    console.log($('video').get(0).paused);
    $('video').get(0).play();
});
function toggleSound(){
    if ($('video').get(0).paused) {
        $('video').get(0).play();
    }
    else {
        $('video').get(0).pause();
    }
}
